package com.example.administrator.bicycle.Kaisuo;public class Info {	private String keys;	private int serverTime;	private int encryptionKey;	private String tradeId;	private String url;	public void setKeys(String keys){		this.keys = keys;	}	public String getKeys(){		return this.keys;	}	public void setServerTime(int serverTime){		this.serverTime = serverTime;	}	public int getServerTime(){		return this.serverTime;	}	public void setEncryptionKey(int encryptionKey){		this.encryptionKey = encryptionKey;	}	public int getEncryptionKey(){		return this.encryptionKey;	}	public void setTradeId(String tradeId){		this.tradeId = tradeId;	}	public String getTradeId(){		return this.tradeId;	}	public void setUrl(String url){		this.url = url;	}	public String getUrl(){		return this.url;	}}